 : kinetic and dynamic profile in the treatment of pain . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ( 4,5- diphenyl - 2 - oxazolepropionic acid ) is a non-steroidal anti-inflammatory drug ( NSAID ) which is effective in models of inflammation , pain and pyrexia . It is effective and well tolerated in the clinical management of adult rheumatoid arthritis ( RA ) , osteoarthritis ( OA ) , ankylosing spondylitis , soft tissue disorders and post operative dental pain . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 has a high oral bioavailability ( 95 % ) , with peak plasma concentrations at 3 to 5 hours after dosing . It is metabolised in the liver by oxidative and conjugative pathways and readily eliminated by the renal and faecal routes .

</mark>
 ' s strong analgesic qualities are particularly useful in painful musculoskeletal conditions such as periarthritis of the shoulder , since it exhibits actions such as inhibition of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 isoenzymes , inhibition of nuclear translocation of NF-kappaB and of metalloproteases , and modulates the endogenous cannabinoid system . This editorial addresses the accompanying paper by Barbara Heller and Rosanna Tarricone on the management of shoulder periarthritis pain , in which they studied the efficacy and safety of oxaprozin compared to the comparator drug diclofenac over a 15 day period . Both oxaprozin and diclofenac compared well in the primary study endpoint of reduction in shoulder pain . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 and diclofenac were well tolerated and oxaprozin showed better improvement in shoulder function and in the mental health item of the SF - 36 quality of life component . The study by Heller and Tarricone is an addition to the large number of clinical trials which demonstrate that oxaprozin has equal efficacy in comparison with standard doses of commonly used anti-rheumatic agents such as aspirin , diclofenac , ibuprofen , indomethacin etc . in several different painful musculoskeletal conditions .</div>

 ( SB 207266 ) , a selective

 did not modify the basal contractions but concentration-dependently antagonized the ability of 5 - HT to enhance bladder strip contractions to O43281 . In presence of 1 and 100 nM of piboserod , the maximal 5 - HT-induced potentiations were reduced to 45.0+ / -7.9 and 38.7+ /-8 . 7 % , respectively . A mean apparent antagonist dissociation constant value ( K ( B ) ) of 0.56+ / -0.09 nM was determined . These data show the ability of piboserod to antagonize with high potency the enhancing properties of 5 - HT on neurally-mediated contractions of isolated human bladder strips . Therefore , the 5 - HT ( 4 ) receptor might represent an attractive pharmacological target for the treatment of overactive bladder .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Distinctive clinicopathological features of Ki-ras mutated colorectal cancers . BACKGROUND AND OBJECTIVES : We explored the relationship between the mutation pattern of Ki-ras and the clinicopathological features of colorectal cancers ( CRCs ) . METHODS : Relationships between clinicopathological parameters and Ki-ras mutation status were analyzed in 255 CRC patients using the chi-square and student t-tests . Kaplan-Meier survival curves were compared using the log-rank test . RESULTS : Ki-ras mutation occurred in 43.9 % of tumors , and 83 % affected codon 12 . The most frequent mutations were

 - &gt; GTT (

<div class="entities" style="line-height: 2.5; direction: ltr">Control of phenylalanine and tyrosine metabolism by phosphorylation mechanisms . A system for the parallel determination of enzyme phosphorylation and expressed activity in rat liver cells , and its application to studies of phenylalanine hydroxylase and tyrosine aminotransferase , is described .

 hydroxylase is phosphorylated by agents which stimulate cyclic AMP - and Ca2 + - dependent protein kinase activity . The phosphorylation site ( s ) appear to be the same for both kinases . Phosphorylation is accompanied by increased metabolic flux at low , physiologically relevant , substrate concentrations .

 and spermine both inhibit the phosphorylation of the enzyme , possibly by increasing dephosphorylation .

 is phosphorylated in liver cell incubations but the rate is slow and insensitive to additions to the medium . No parallel changes in flux could be detected . Both enzymes are subject to complex regulatory mechanisms , short - and long-term . Their activities may be coordinated in vivo by control exerted at the level of the plasma membrane where both amino acids share the same transport processes . Determination of the control coefficients for the several components indicates that membrane transport may be a major limitation on flux .</div>
